const Header=()=>{
    return(
        <ul className="heading-list">
            <li>File</li>
            <li>Edit</li>
            <li>View</li>
            <li>Insert</li>
            <li>Format</li>
            <li>Tools</li>
        </ul>
    )
}
export default Header;
